Thanking you guys!

As we ( the Actors) prepare to go on strike tonight in solidarity with our union, I wanted to share this last bit of public adoration for the art form that I love, that I’ve loved since I was a little girl. I’ve admired the commitment  of actors and their ability to tell stories so much so that I went tunnel vision to the idea of doing what they did so well. Too many people to mention but I do  know that my excitement in this video would not have manifested the same if it were not for the actors who’s work changed the trajectory of my life or the writers who wrote the roles that gave them the space and opportunity to do so.

Yesterday history was made in the course of my own life. The feeling that I had  and still have will have to hold me over until this is all resolved but boy what a high note ( or shriek 🫠) to end on. 

Thank you again to the @televisionacad and all the Artists, crew and folks who voted.  Love you guys.

